export const params = {
    autoHeight: true,
    direction: 'vertical',
    pagination: {
        el: '.swiper-pagination',
        type: 'bullets',
        clickable: true
    },
    mousewheel: {
        sensitivity: 2,
        releaseOnEdges: true
    },
    touchReleaseOnEdges: true
};
